import React from "react";

export default function Refecto({ data }) {
  const recur = (data) => {
    for (var key in data) {
      if (typeof data[key] === "object" && data[key] !== null) {
        recur(data[key]);
      } else if (typeof data[key] === "string") {
        try {
          JSON.parse(data[key], (_, val) => {
            if (typeof val === "string") console.log("string");
            else {
              console.log(val);
            }
          });
        } catch (err) {
          console.log(err);
        }
      } else {
        //console.log(key + ":" + data[key]);
        //return { [key]: data[key] };
      }
    }
  };

  return (
    <div className="code-block">
      <pre>{recur(data)}</pre>
    </div>
  );
}
